Information
------------------------------

On March 2, 1962 Wilt Chamberlain and the Philadelphia Warriors hosted the New York Knicks in Hershey, PA. On that night, Chamberlain scored an NBA-record 100 points, a mark that has never been close to being approached. Wilt went 36-63 from the field and 28-32 from the free throw line on the night. The out-of-this-world performance was the highlight of a season in which he went on to average 50.4 points and 25.7 rebounds per game. 
On the 50th anniversary of arguably the greatest individual performance in sports history NBA TV will retell the story of the feat. &quot;Wilt 100,&quot; an NBA TV original film narrated by Chamberlain's chief rival and good friend, Hall of Famer Bill Russell.
Utilizing rarely-seen interviews with Chamberlain, the hour-long documentary will take viewers back to the night in Hershey, Pa., that will live forever in history, when &quot;The Big Dipper&quot; led his Philadelphia Warriors in a 169-147 victory over the New York Knicks. With no existing footage from the game and only about 4,000 witnesses to the event, NBA TV has woven Chamberlain's own recollections, fresh interviews with Hershey natives in attendance that night and stories from Warriors employees and Chamberlain's NBA contemporaries to bring the performance back to life.
To help further paint the picture of this legendary performance, NBA TV adds depth to many of the long-told tales of the night - ranging from non-fiction to fable and everything in between. Subjects include the four-time NBA MVP's can't-miss pre-game performance at the rifle arcade at Hershey Arena and as lore has it, his ride back home to New York City in the backseat of a car driven by members of the Knicks team he just defeated. The documentary also gives viewers a new appreciation for something that is decided fact: Chamberlain's incredible 1962 season and Wilt's role in revolutionizing the NBA game.

